import type { NextApiRequest, NextApiResponse } from "next";
import { JSDOM } from "jsdom";
import axios from "axios";

type Item = {
  name: string;
  code: string;
  freq: number[];
  avgPercent: number;
};

export default async function handler(req: NextApiRequest, res: NextApiResponse<any>) {
  try {
    const locationId = req.query.locationId;
    const url = `https://ebird.org/hotspot/${locationId}/media?yr=all&m=`;

    /*const response = await axios.get(url, {
      headers: {
        // This user agent seems to be allowed by eBird
        "User-Agent": "Mozilla/5.0 (compatible; Googlebot/2.1; +http://www.google.com/bot.html)",
      },
      maxRedirects: 2,
    });

    const html = response.data;*/
    const html = mockHtml;

    const dom = new JSDOM(html);
    const rows = dom.window.document.querySelectorAll("article.SpeciesRecord");

    const results: Item[] = [];

    rows?.forEach((row) => {
      const h3 = row.querySelector("h3");
      const name = h3?.textContent?.trim();
      const code = row?.getAttribute("id")?.trim();
      const percents = row
        .getAttribute("data-freq")
        ?.replace("[", "")
        ?.replace("]", "")
        ?.split(",")
        .map((percent) => Number(percent.replace("%", "").trim()));

      const avgPercent = !!percents?.length ? percents?.reduce((a, b) => a + b, 0) / percents?.length : 0;
      console.log(name, Math.round(avgPercent || 0));
      if (name && code && !!percents?.length) {
        results.push({
          name,
          code,
          percents,
          avgPercent: Math.round(avgPercent || 0),
        });
      }
    });

    const sortedResults = results.sort((a, b) => b.avgPercent - a.avgPercent);

    //res.setHeader("Cache-Control", "max-age=0, s-maxage=2592000"); //Cache for 30 days
    res.status(200).json({ success: true, results: sortedResults });
  } catch (error: any) {
    console.log(error);
    res.status(500).json({ error: error.message });
  }
}

