	"license.p3": "You warrant that the Content is either owned by you, or in the public domain. You agree that you will hold Cornell Lab and Cornell University harmless from any claims of Content ownership or infringement by any other person or entity. You agree that you are solely responsible for protecting the Content from infringement by a third party; Cornell Lab is not responsible for pursuing such claims on your behalf.",
