	"index.ticksExplanation": "What are ticks?",
	"index.progressExplanation": "What is eBirding over time?",
	"index.ticksExplanationFull": "“Ticks” are a way to understand how much birding you’ve done across different parts of a region. Ticks are calculated by adding up the number of species you’ve reported from every subregion within a larger region. For example: if you reported the same 100 species in 3 different countries, you’d have 300 World country ticks. The best way to increase your ticks is by visiting new regions!",
	"index.progressExplanationFull": "\"eBirding over time\" charts compare your eBird activity among years. The blue bars and numbers to the left show how many species or checklists you submitted from the first of the year or month up to today’s date that year. The gray bars and numbers to the right show your totals at the end of that year or month. Are you ahead of where you were this time last year? What year was your personal best?",
