	"exotic.categoryP.desc": "Either: 1) member of exotic population that is breeding in the wild, self-propagating, and has persisted for multiple years, but not yet Naturalized; 2) rarity of uncertain provenance, with natural vagrancy or captive provenance both considered plausible. When applicable, eBird generally defers to bird records committees for records formally considered to be of \"uncertain provenance\". Provisional species count in official eBird totals.",
